import ReactDOM from 'react-dom';
import './index.css'
import {BrowserRouter} from "react-router-dom";
import Body from "./components/Body";
import store from "./redux/store";

console.log('store初始状态：',store.getState());

ReactDOM.render(
    <BrowserRouter>
        <Body/>
    </BrowserRouter>,
    document.getElementById('root')
);
store.subscribe(() => {
    console.log('store更新后的状态:',store.getState());
    ReactDOM.render(
        <BrowserRouter>
            <Body/>
        </BrowserRouter>,
        document.getElementById('root')
    );
});
